import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Wait for the video items to load
    await page.waitForSelector('.video-item:nth-child(-n+5) .video-title');

    // Extract titles of the first 5 videos
    const videoTitles = await page.$$eval('.video-item:nth-child(-n+5) .video-title', titles => titles.map(title => title.textContent.trim()));

    // Take screenshot after extracting titles
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_titles_extracted.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_titles_extracted.png'));

    return {
      success: true,
      action: "Extracted titles of the first 5 videos from the homepage",
      extractedData: { videoTitles },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete task",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}

